import React from 'react';
import { Collapse, Button } from 'react-bootstrap';
import Fields from './fieldset.jsx';
import '../style/style.css';

const Workspace = ({exploreOpen, handlePlus, counter, inputValue, handleInput}) => {

    const datafield  =[{"box1":<input type="tel"   value={inputValue} onChange={(e)=>handleInput(e)}/>,
                        "box2":  <input type="text"   value={inputValue}/>,
                        "box3":  <input type="text"   value={inputValue}/>,
                        "box4":  <input type="text"   value={inputValue}/>,
                          },
                          {"box1":<input type="text" value={inputValue} />,
                          "box2":  <input type="text" value={inputValue} />,
                          "box3":  <input type="text" value={inputValue} />,
                          "box4":  <input type="text" value={inputValue} />,
                      },{"box1":<input type="text" value={inputValue} />,
                      "box2":  <input type="text" value={inputValue} />,
                      "box3":  <input type="text" value={inputValue} />,
                      "box4":  <input type="text" value={inputValue} />,
                      }];
 const equal = "="
 const multiple = "x"
 const plus = "+"


    return ( 
        <div className={'feild_wrap'}>
                <div><Collapse in={exploreOpen}>
                   <div id="example-collapse-text"  className={'inn_wrap'}>
                   <Button onClick ={() => handlePlus()}>Plus</Button>

                   <Collapse in={handlePlus}>
                    <div id="example-collapse-text"  className={'formwrap'}>
                      
                          {datafield.map((d, index)=>{
                                  return (<Fields key={index}>{d.box1}{equal}{d.box2}{multiple}{d.box3}{plus}{d.box4}</Fields>)
                              })}
                              </div>
                  </Collapse>
                              <Button style={{float: 'right'}}>Submit</Button>
                   </div>
          </Collapse>
          </div>
        </div>
     )
   };
   
   export default Workspace;
